import React, { Component } from "react";
import Nav from "react-bootstrap/Nav";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.state = { hidden: false };

    this.showEducation = this.showEducation.bind(this);
  }

  showEducation() {
    if ((this.state.hidden = false))
      document.getElementsByClassName("education")[0].style.display = "none";
  }

  render() {
    return (
      <Nav justify variant="tabs" defaultActiveKey="background">
        <Nav.Item>
          <Nav.Link eventKey="background">BACKGROUND</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link
            id="education"
            eventKey="education"
            onClick={this.showEducation}
          >
            EDUCATION
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="experience">EXPERIENCE</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="skills">SKILLS</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="apps">SOFTWARE</Nav.Link>
        </Nav.Item>
      </Nav>
    );
  }
}

export default Navbar;
